class Solution:    def findErrorNums(self, nums):        """        :type nums: List[int]        :rtype: List[int]        """        n=len(nums)        dict={}        for i in range(n):            if nums[i] not in dict:                dict[nums[i]]=1            else:                dict[nums[i]]+=1                duonumber=nums[i]                break        shaonumber=int(n*(n+1)/2)-sum(nums)+duonumber        return [duonumber,shaonumber]nums=[1,2,2,4]s=Solution()print(s.findErrorNums(nums))